import { useEffect, useState } from "react";

function ComponentStagiaires() {
  let Stagiaires = [
    {
      id: 1,
      matricule: 1454,
      nom: "Alaoui ",
      codepostal: 20400,
      ville: "casa",
      moyenne: 12.56,
    },
    {
      id: 2,
      matricule: 1455,
      nom: "Mansouri ",
      codepostal: 20400,
      ville: "casa",
      moyenne: 14.67,
    },
  ];

  let [stagiaire, setStagiaire] = useState({
    id: null,
    matricule: 0,
    nom: "",
    codepostal: 0,
    ville: "",
    moyenne: 0,
  });

  // let [message,setMessage] = useState("")

  let [listStagiaires, setListStagiaires] = useState([]);

  useEffect(() => {
    setListStagiaires(Stagiaires);
  }, []);

  function stagiaireId() {
    return listStagiaires.length + 1;
  }

  function ajouter() {
    const newStagire = { ...stagiaire, id: stagiaireId() };
    setListStagiaires([...listStagiaires, newStagire]);
  }

  return (
    <>
      <div>
        <input type="number" placeholder="id" required value={stagiaireId()} />
        <input
          type="number"
          placeholder="matricule"
          required
          onChange={(e) =>
            setStagiaire({ ...stagiaire, matricule: e.target.value })
          }
        />
        <input
          type="text"
          placeholder="nom"
          required
          onChange={(e) => setStagiaire({ ...stagiaire, nom: e.target.value })}
        />
        <input
          type="number"
          placeholder="codepostal"
          required
          onChange={(e) =>
            setStagiaire({ ...stagiaire, codepostal: e.target.value })
          }
        />
        <input
          type="text"
          placeholder="ville"
          required
          onChange={(e) =>
            setStagiaire({ ...stagiaire, ville: e.target.value })
          }
        />
        <input
          type="number"
          placeholder="moyenne"
          required
          onChange={(e) =>
            setStagiaire({ ...stagiaire, moyenne: e.target.value })
          }
        />

        <button onClick={ajouter}>Ajouter</button>
      </div>

      <table>
        <thead>
          <th>id</th>
          <th>matricule</th>
          <th>Nom</th>
          <th>ville</th>
          <th>code Postal</th>
          <th>Moyenne</th>
          <th>supprimer</th>
          <th>Editer</th>
        </thead>

        <tbody>
          {listStagiaires.map((item, index) => {
            return (
              <>
                <tr key={index}>
                  <td>{item.id}</td>
                  <td>{item.matricule}</td>
                  <td>{item.nom}</td>
                  <td>{item.codepostal}</td>
                  <td>{item.ville}</td>
                  <td>{item.moyenne}</td>
                  <td>
                    <button>supprimer</button>
                  </td>
                  <td>
                    <button>editer</button>
                  </td>
                </tr>
              </>
            );
          })}
        </tbody>
      </table>
    </>
  );
}

export default ComponentStagiaires;
